/* harmony default export */ __webpack_exports__["default"] = ("\n<section class=\"asset-wrapper page-wrapper\">\n    <div class=\"page-block bg-gray-50 container-fluid\">\n        <div class=\"container\">\n            <div class=\"row\">\n                <div class=\"col-sm-10 offset-sm-1\">\n                    <h2 class=\"title\">FAQs</h2>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n\n<section class=\"spacer-block pb-0\">\n\n    <div class=\"container\">\n\n        <div class=\"row\">\n            <div class=\"col-sm-12\">\n                <p class=\"pb-4\">The Servioo application has an extensive feature set, simplifying the way you manage assets, helpdesk tickets, visitors, parcel deliveries, staffs, maintenance payments and much more</p>\n                <p>We're often asked about our thinking behind, how you could get started and use our application. We've compiled our responses to some of them below</p>\n            </div>\n        </div>\n\n    </div>\n\n</section>\n\n<section class=\"faq-wrapper spacer-block\" id=\"faqAccordion\">\n\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-sm-10 offset-sm-1\">\n                <ul class=\"list-group tabs clear\">\n    \n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(1)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse1\" aria-expanded=\"true\" aria-controls=\"collapse1\" (click)=\"setActiveTab(1)\" [ngClass]=\"isActive(1)\">\n                            <h4>What is Servioo?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n                        </li>\n                        <div id=\"collapse1\" class=\"collapse\" aria-labelledby=\"collapse1\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Servioo is a web portal that provides tools to effectively manage and easily maintain the almost all aspects of your residential complex, be it Condo Communities, Private Layouts, Row houses, Villas, Single Family Homes, Town Homes, Executive Village or even a Colony. </h6>\n                            </div>\n                        </div>\n                    </div>\n            \n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(2)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse2\" aria-expanded=\"true\" aria-controls=\"collapse2\" (click)=\"setActiveTab(2)\" [ngClass]=\"isActive(2)\">\n                            <h4>I want my Condo to get started with Servioo, what are the next steps?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse2\" class=\"collapse\" aria-labelledby=\"collapse2\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Please get started by filling in the details in the Contact Us. Soon after you submit your request, the support team from Servioo will reach out to you to set up your condo's private, secure portal in Servioo in 1 or 2 business days.</h6>\n                            </div>\n                        </div>\n                    </div>\n            \n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(3)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse3\" aria-expanded=\"true\" aria-controls=\"collapse3\" (click)=\"setActiveTab(3)\" [ngClass]=\"isActive(3)\">\n                            <h4>Our Condo is still under construction or we are yet to form a committee, can we still use Servioo?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse3\" class=\"collapse\" aria-labelledby=\"collapse3\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Yes. We absolutely understand the importance of all owners having a common platform to discuss topics related to their condo even before an association is formed and funds are available.</h6>\n                                <h6 class=\"mt-4\">Thus, we offer Servioo for condos who are yet to take possession or yet to form an association free of cost. You just need to register your condos by providing your details in the Contact Us form</h6>\n                            </div>\n                        </div>\n                    </div>\n            \n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(4)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse4\" aria-expanded=\"true\" aria-controls=\"collapse4\" (click)=\"setActiveTab(4)\" [ngClass]=\"isActive(4)\">\n                            <h4>What is the price of using Servioo?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse4\" class=\"collapse\" aria-labelledby=\"collapse4\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Servioo is offered in two different pricing plans. There is a free edition for any condo / society/ residential complex to get started with limited features and then paid editions with advanced features for active housing societies</h6>\n                                <h6 class=\"mt-4\">We have multiple packages to choose from and it depends on the number of condo units. We can assure our price is very competitive</h6>\n                            </div>\n                        </div>\n                    </div>\n                    \n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(5)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse5\" aria-expanded=\"true\" aria-controls=\"collapse5\" (click)=\"setActiveTab(5)\" [ngClass]=\"isActive(5)\">\n                            <h4>Is there a trial period? And if we do not want to use Servioo after trial, do we need to pay for the usage?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse5\" class=\"collapse\" aria-labelledby=\"collapse5\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Yes, there is a trial period of 15 days. If you decide not to use Servioo after your 15-day trial, you need not pay. This is a no-obligation trial. You can continue to use the free edition with limited features without paying anything</h6>\n                            </div>\n                        </div>\n                    </div>\n\n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(6)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse6\" aria-expanded=\"true\" aria-controls=\"collapse6\" (click)=\"setActiveTab(6)\" [ngClass]=\"isActive(6)\">\n                            <h4>How can Condo Committee members use Servioo?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse6\" class=\"collapse\" aria-labelledby=\"collapse6\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Servioo provides a host of Administration tools/features that helps the Property Management committees to ensure smooth functioning of the condo. Please book for a <a href=\"javascript:void(0)\">demo</a> to know more</h6>\n                            </div>\n                        </div>\n                    </div>\n\n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(7)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse7\" aria-expanded=\"true\" aria-controls=\"collapse7\" (click)=\"setActiveTab(7)\" [ngClass]=\"isActive(7)\">\n                            <h4>How can residents (Owners / Tenants) use Servioo?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse7\" class=\"collapse\" aria-labelledby=\"collapse7\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Servioo brings together the owners/residents on to a common platform and promotes condo living. Please check the features in the website and book a <a href=\"javascript:void(0)\">demo</a> to know more</h6>\n                            </div>\n                        </div>\n                    </div>\n\n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(8)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse8\" aria-expanded=\"true\" aria-controls=\"collapse8\" (click)=\"setActiveTab(8)\" [ngClass]=\"isActive(8)\">\n                            <h4>What types of support is offered by Servioo?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse8\" class=\"collapse\" aria-labelledby=\"collapse8\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Our support staff are well trained, helpful and service oriented. We help you with initial setup to load your condo details and past data (such as residents data, expense history, assets, inventories, vehicles, pets, parking lots), email support, training your admin team and staff.</h6>\n                            </div>\n                        </div>\n                    </div>\n\n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(9)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse9\" aria-expanded=\"true\" aria-controls=\"collapse9\" (click)=\"setActiveTab(9)\" [ngClass]=\"isActive(9)\">\n                            <h4>Is our data secure and confidential in Servioo?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse9\" class=\"collapse\" aria-labelledby=\"collapse9\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>With no doubt, Yes. Servioo uses industry standard security practices to protect your data and confidential information</h6>\n                                <h6 class=\"mt-4\">Servioo uses Secure Socket Layer(SSL) technology to encrypt the entire transmission of data between your browser and our server. SH512 Algorithm is used for data security</h6>\n                                <h6 class=\"mt-4\">All data is hosted on Azure cloud. The application works in SAAS(Software as a service) model</h6>\n                                <h6 class=\"mt-4\">In addition, Servioo has strict user access control in place - the information of your condo is only visible to the members of your condo and not other users of Servioo. Even within the same condo, the information is visible based on the roles of the user. Only administrators can view all the information related to the condo. Members with other roles can see only that information that is needed</h6>\n                            </div>\n                        </div>\n                    </div>\n\n                    <div class=\"accordion-content-wrapper\" [ngClass]=\"isActive(10)\">\n                        <li class=\"list-group-item collapsed\" data-toggle=\"collapse\" data-target=\"#collapse10\" aria-expanded=\"true\" aria-controls=\"collapse10\" (click)=\"setActiveTab(10)\" [ngClass]=\"isActive(10)\">\n                            <h4>I have more questions, whom shall I reach out?</h4>\n                            <div class=\"float-right icons\">\n                                <img class=\"plus svg\" src=\"assets/images/faq-plus-icon.svg\">\n                            </div>\n            \n                        </li>\n                        <div id=\"collapse10\" class=\"collapse\" aria-labelledby=\"collapse10\" data-parent=\"#faqAccordion\">\n                            <div class=\"details\">\n                                <h6>Please reach us at the details available on our Contact Us page. You can submit your query on the same page with your details and we will respond back</h6>\n                            </div>\n                        </div>\n                    </div>\n            \n                </ul>\n            </div>\n        </div>\n    </div>\n\n</section>\n\n");

