/* harmony default export */ __webpack_exports__["default"] = ("<section class=\"privacy-wrapper page-wrapper\">\n    <div class=\"page-block bg-gray-50 container-fluid\">\n        <div class=\"container\">\n            <div class=\"row\">\n                <div class=\"col-sm-10 offset-sm-1\">\n                    <h2 class=\"title\">Privacy Policy</h2>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n\n<section class=\"privacy-block spacer-block pb-0\">\n\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-sm-12\">\n                <div class=\"content\">\n                    <h5 class=\"pb-5 text-uppercase text-secondary\">CloudPragma Technologies does not sell, rent or otherwise make available the personal information of the Users, Visitors, Association Staff, Domestic Staff or the common information of the Multi Dwelling Unit to any third-party, without their explicit approval.</h5>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">REGISTRATION</h4>\n                        <p>In order to use the Products, a user must first complete the registration form. During registration a user is required to give their contact information and proof of being associated with the Multi Dwelling Unit. The registration information given by the user must always be accurate, correct and up to date. This ensures the User can get the maximum benefit from the Product.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">YOUR PERSONAL INFORMATION</h4>\n                        <p>The User stores information about himself/herself under his/her User Profile. Information provided is available to the User and the Administrative Users belonging to the same Multi Dwelling Unit as the user. The Visitor information entered in Servioo Gatekeeper is available to the Unit to which the Visitor is visiting, and to the Administrative Users belonging to the same Multi Dwelling Unit as the user. The Domestic Staff information entered in Servioo Gatekeeper is available to the Flats in which the specific Domestic Staff member works and to the Administrative Users belonging to the specific Multi Dwelling Unit. The Vendor information entered is available to the Administrative Users belonging to the specific Multi Dwelling Unit. Administrative Users may also enter Personal INformation of the Users. CloudPragma Technologies takes no responsibility for the accuracy of such data entered by the Users or Administrative Users.</p>\n                        <p class=\"pt-5\">These Personal Information are retained for the period covered by the Subscription Term, unless the Administrative Users choose to delete the Personal Information.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">LINKS</h4>\n                        <p>Links to other sites may be present in the Products. Please be aware that we are not responsible for the privacy practices of such other sites. Please be aware when you leave the Product site and visit these other sites, to read the privacy statements of such sites especially in case they collect personally identifiable information. This privacy policy applies solely to information collected by the Products of CloudPragma Technologies.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">MOBILE APPS</h4>\n                        <p>The Mobile Apps of the Product may seek access to data stores in your Mobile Phone, such as SMS, Photos, Contact List etc. The purpose of this access is solely towards complete functionality of relevant Product Features. The Mobile Apps will not run to their full potential if you choose to not provide the necessary access.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">BUZZAR</h4>\n                        <p>The Buzzar is a feature provided for Users for availing useful services for their Home or Multi Dwelling Unit. The User understands that any information provided by the User on Buzzar, is visible outside his Servioo. The User is responsible for any information they share via Buzzar.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">SECURITY</h4>\n                        <p>CloudPragma Technologies takes every precaution to protect users' information. When users submit sensitive information via the portal, the information is protected both online and off-line. We have enabled SSL encryption so as to ensure that your data remains encrypted during transmission to and from the site. These precautions, though industry standard are nonetheless only as secure as the end-user's practice. To ensure that unauthorised parties do not get access to information on this portal, we encourage all users make sure that they log-off from all sessions - especially from public computers such as at internet cafes.</p>\n                        <p class=\"pt-5\">As part of our disaster recovery strategy, we have regular backups taken to protect you from sudden data loss. If you have any questions about the security at our portal, you can send an email to support@Servioo.in (for Users belonging Indian Multi Dwelling Units) </p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">SITE AND SERVICE UPDATES</h4>\n                        <p>We also send the user site and service announcement updates. Users may choose to unsubscribe from receiving these emails by following the instructions that will be part of each announcement email.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">NOTIFICATION OF CHANGES</h4>\n                        <p>Any change made to the Privacy Policy will be posted on the Homepage so our users are always kept aware. Also they will be notified via Email about any such change.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">NOTIFICATION TO VISITORS (for Servioo Gatekeeper usage)</h4>\n                        <p>While Users belong to the legal entity of an Association and may receive important notifications on their Mobile Number, Visitors are not part of the Association. Notification to Visitor Mobile Numbers, if any, will be strictly as per the relevant Telecom Regulations.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">PRIVACY AND SECURITY OF PAYMENT INFORMATION</h4>\n                        <p>CloudPragma Technologies makes it possible for the User to pay various charges via its Products. Details of securing the Payment Information is available in a separate Terms knows as the <a href=\"javascript:void(0)\">“PAYMENT GATEWAY TERMS”</a></p>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n\n</section>\n\n");

