/* harmony default export */ __webpack_exports__["default"] = ("\n<section class=\"terms-wrapper page-wrapper\">\n    <div class=\"page-block bg-gray-50 container-fluid\">\n        <div class=\"container\">\n            <div class=\"row\">\n                <div class=\"col-sm-10 offset-sm-1\">\n                    <h2 class=\"title\">Terms Of Service</h2>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n\n<section class=\"terms-block spacer-block pb-0\">\n\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col-sm-12\">\n                <div class=\"content\">\n                    <h4 class=\"pb-5 text-uppercase text-hint\">The below terms of service are applicable to all Users of the Portals: Servioo.in and the mobile Apps</h4>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-4 text-uppercase\">DEFINITIONS</h4>\n                        <p>\"CloudPragma Technologies\", \"We\" represent the \"Service Provider\" and are interchangeable. It also represents any subsidiary company of CloudPragma Technologies Pvt. Ltd.</p>\n                        <p class=\"pt-4\">\"Products\" imply all offerings of CloudPragma Technologies, that are SaaS (Software as a Service) Products including but not limited to the Portals: Servioo.in and the Mobile Apps: Servioo.in</p>\n                        <p class=\"pt-4\">\"Apartment Complex\" or \"Multi Dwelling Unit\" can mean a Villa Complex or an Apartment Complex or a Commercial Complex. It can also imply any such Organisation of Users utilising the Software Products.</p>\n                        <p class=\"pt-4\">\"Servioo\" means the specific Portal of the specific Multi Dwelling Unit, accessible to Residents and Office Staff of only that Multi Dwelling Unit.</p>\n                        <p class=\"pt-4\">\"Association\", \"Society\", \"RWA\" are used interchangeably.</p>\n                        <p class=\"pt-4\">\" Servioo \" and \" Servioo Apps\" are used interchangeably to imply the Product that automates Workflows in Communication, Facility Management, Billing, Collection and Accounting.</p>\n                        <p class=\"pt-4\">Subscription Term: Period for which Subscription Payment has been made.</p>\n                        <p class=\"pt-5 font-medium\">The following paragraphs contain further information about our Terms of Service, Privacy Policy, Payment Gateway Terms. Please make sure you read through this carefully. Please proceed with the use of the Products upon agreement with the Terms.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <p class=\"font-bold pb-5\">CloudPragma Technologies provides its service to you, subject to the following Terms of Service (\"TOS\"), which may be updated by us from time to time with information to you.</p>\n                        <h4 class=\"font-bold pt-5 pb-3 text-uppercase\">1. DESCRIPTION OF SERVICE</h4>\n                        <p class=\"pb-4\"><span class=\"font-medium\">CloudPragma Technologies</span> provides a suite of Products categorised as below</p>\n                        <ul class=\"lists alpha\">\n                            <li>The “Servioo” which provides Central Database of the Multi Dwelling Unit, integrated with Tools for Communication, Facility Management, Billing and Accounting.</li>\n                            <li>The “Servioo Security” that digitises Security Workflow of the Multi Dwelling Unit.</li>\n                            <li>The “Servioo” which is used by each Resident of the Multi Dwelling Unit, and is a Companion App/Portal to above two products.All 3 products are integrated with each other. Depending on the access available to You, You may use any or all of these Products. Up-to-Date information on the Service Offerings are found on the Pricing Link of the website.</li>\n                            <li>Donec vitae quam vitae tellus pulvinar vulputate vel nec tellus</li>\n                        </ul>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">2. CloudPragma Technologies PRIVACY POLICY</h4>\n                        <p>Personal information about you are subject to our PRIVACY POLICY which is a section in these Terms.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">3. USER ACCOUNT, PASSWORD AND SECURITY</h4>\n                        <p>You are responsible for maintaining the confidentiality of the UserID and password you choose when you create your account, and are fully responsible for all activities that occur under your account. You agree to immediately notify CloudPragma Technologies of any unauthorized use of your password. CloudPragma Technologies will not be liable for any consequence arising from your failure to comply with this Section.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">4. ABUSE OF SERVICE</h4>\n                        <p>You understand that all information (such as data files, written text, audio files, images or any other media) which you may have access to as part of, or through your use of the Products of CloudPragma Technologies are the sole responsibility of the person from which such content originated. CloudPragma Technologies takes no responsibility for abusive content, and it is the responsibility of the users to regulate such content. CloudPragma Technologies takes no responsibility for any data generated within any of its Products and published or distributed outside by the user.</p>\n                        <p class=\"pt-4\">In case of Servioo Gatekeeper usage the Association and Administrative Users take responsibility to treat the Visitor Data with same Privacy and Sanctity that they do for Visitor Data captured prior to use of Servioo Gatekeeper. CloudPragma Technologies takes no responsibility for any data captured in Servioo Gatekeeper and published or distributed outside by any User having access to such Data.CloudPragma Technologies reserves the right to suspend its service to Users involving in service abuse.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">5. LIST OF PROHIBITED ITEMS</h4>\n                        <p>Users are prohibited from aiding in the sale / exchange of any item present in the below list. This is only a partial list and items can be added as and when prohibited to law or brought to the notice of CloudPragma Technologies.Airline tickets that restrict transfer, other unauthorized ticket sale - Alcohol or tobacco products - Blood, bodily fluids or parts - Bulk email or mailing lists that contain names, addresses, phone numbers, or other personal identifying info Burglary tools, including but not limited to lock-picks or motor vehicle keys - Controlled substances or illegal drugs, substances and items used to manufacture controlled substances and drug paraphernalia -Counterfeit currency, coins and stamps, tickets, as well as equipment designed to make them - Counterfeit, replica, or knock-off brand name goods - Coupons or gift cards that restrict transfer, other unauthorized coupons or gift cards - False identification cards, forged certificates - Fireworks, firearms and explosives - Gambling items, including but not limited to lottery tickets - Material that infringes copyright, including but not limited to software or other unauthorized digital goods sale - Pornography - Pet animal parts, blood, or fluids - Prescription drugs and medical devices, including but not limited to prescription or contact lenses, defibrillators, hypodermic needles or hearing aids - Stolen property, or property with serial number removed or altered.</p>\n                        <p class=\"pt-5\">Items can be included in the above list as and when prohibited.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">6. NO RESALE OF SERVICE</h4>\n                        <p>You agree not to reproduce, duplicate, copy, sell, resell or exploit for any commercial purposes, any portion of the Products, use of the Products, or access to the Products.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">7. MODIFICATIONS TO SERVICE</h4>\n                        <p>As SaaS products, all of CloudPragma Technologies offerings will undergo continuous modifications in its Features and Service. In case any feature or service is phased out, adequate time and notice will be given to you, so that you may retain the Information assets created by you as part of that Feature. Beyond the time given, you agree that CloudPragma Technologies shall not be liable to you or to any third party.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">8. CloudPragma Technologies PROPRIETARY RIGHTS</h4>\n                        <p>You acknowledge and agree that the Products contain proprietary and confidential information that is protected by applicable intellectual property and other laws. Except as expressly authorized by CloudPragma Technologies, you agree not to modify, rent, lease, loan, sell, distribute or create derivative works based on the Products, in whole or in part. You also agree not to extract the code or reverse-engineer it in anyway. Any attempt at hacking or unlawful use of the Products can and will invite the maximum prosecution allowable under the law.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">9. WARRANTIES AND DISCLAIMERS</h4>\n                        <p>Our Warranties. We warrant that</p>\n                        <ul class=\"lists roman\">\n                            <li>The Products shall perform materially in accordance with the Functionality listed in Features List</li>\n                            <li>the functionality of the Products will not be materially decreased during a subscription term. A Subscription Term is defined by the term for which the Subscription Payment is already made. For any breach of either such warranty, your exclusive remedy shall be Termination of Use including Refund of Advance Payments made for the Subscription Term.                                </li>\n                        </ul>\n                        <p class=\"pt-4\">For integrations of the Product with 3rd Party Software or Hardware, CloudPragma Technologies warrants that it will perform due diligence while selecting the 3rd Party Software or Hardware. However, CloudPragma Technologies does not warrant error-free functioning of such 3rd Party Software or Hardware.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">10. LIMITATION OF LIABILITY</h4>\n                        <p>In no event shall either party’s aggregate liability arising out of or related to these Terms/Agreement, whether in contract, tort or under any other theory of liability, exceed the total amount paid by you under the current active Subscription Term.</p>\n                        <p class=\"pt-4\">In specific CloudPragma Technologies is not liable to respond to queries from third parties about a Multi Dwelling Unit’s use of the Product. All queries must come from the officially designated Users of the Multi Dwelling Unit itself.</p>\n                        <p class=\"pt-4\">By using this Product You confirm that You have the legal authority of uploading and sharing the specific data that You would upload or share on this Product. You indemnify CloudPragma Technologies of any disputes regarding the ownership of such data.</p>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">11.Support SLA</h4>\n                        <p>In no event shall either party’s aggregate liability arising out of or related to these Terms/Agreement, whether in contract, tort or under any other theory of liability, exceed the total amount paid by you under the current active Subscription Term.</p>\n                        <ul class=\"lists alpha\">\n                            <li>All Support queries are to be lodged using the \"Software Help\" feature present on the Products. If the issue is related to log in, support email can be sent to support@Servioo.in (for Users belonging to Indian Multi Dwelling Units) </li>\n                            <li>All support queries will receive initial response within maximum 16 business hours of CloudPragma Technologies receiving the request. Business hours are 9AM to 6PM, IST. Support SLAs are available to all Users covered by a Subscription Term. Support SLAs are not available to Users on Trial, or any other UnPaid Usage mode.</li>\n                        </ul>\n                    </div>\n                    <div class=\"desp pt-5 pb-5\">\n                        <h4 class=\"font-bold pb-3 text-uppercase\">12. Exit of Subscription</h4>\n                        <p>This agreement is subject to review by either party at any time during the Subscription Term. If either party requires terminating this agreement, 30 days notice must be given and the data will be available for the customer to be extracted during this period.​ The notice period has to be within the subscription paid duration (Subscription Term).</p>\n                        <p class=\"pt-4\">After such 30-day period, The Service Provider shall have no obligation to maintain or provide any of the Customer’s Data and shall thereafter, unless legally prohibited, delete all of Customer’s Data in the Service Provider’s systems or otherwise in its possession or under its control.</p>\n                        <p class=\"pt-4\">Upon non-payment of Subscription Dues within the Subscription Invoice Due Date, the Subscription is considered terminated and Access to the product is discontinued for the Customer.</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n\n</section>\n\n");

